// routes.js
import React from 'react';
import { Route, Routes } from 'react-router-dom';
import PopisBodova from './pages/PopisBodova';

const AppRoutes = () => (
    <Routes>
        <Route path="/popis-bodova" element={<PopisBodova />} />
    </Routes>
);

export default AppRoutes;
